import React from "react";
import Nav from "./Nav";
import Footer from "./Footer";

function Body() {
  return (
    <div className="App container">
      <div class="row">
        <div class="col-4">
          <Nav />
        </div>
        <div class="col-8">
          <Body />
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default Body;
